import React from 'react';
import { Button } from "@material-ui/core";
import InputLabel from '@material-ui/core/InputLabel';
import SocialLoginButton from './SocialLoginButton';
import InputAdornment from '@material-ui/core/InputAdornment';
import Input from '@material-ui/core/Input';
import FormControl from '@material-ui/core/FormControl';
import PersonIcon from '@material-ui/icons/Person';
import LockIcon from '@material-ui/icons/Lock';
export default function AuthPanel() {
    let trysuccess = (user: any) => {
        console.log(user);
    };

    let catcherr = (err: any) => {
        console.log(err);
    };
    return (
        <div className="login-div">
            <h3>התחברות</h3>
            <form action="">
                <div className="userName">
                    <FormControl >
                        <InputLabel htmlFor="input-with-icon-adornment">שם משתמש</InputLabel>
                        <Input
                            id="input-with-icon-adornment"
                            startAdornment={
                                <InputAdornment position="start">
                                    <PersonIcon />
                                </InputAdornment>
                            }
                        />
                    </FormControl>
                </div>
                <div className="password">
                    <FormControl >
                        <InputLabel htmlFor="input-with-icon-adornment">סיסמא</InputLabel>
                        <Input
                            id="input-with-icon-adornment"
                            startAdornment={
                                <InputAdornment position="start">
                                    <LockIcon />
                                </InputAdornment>
                            }
                        />
                    </FormControl>
                </div>
                <span>שכחתי סיסמא</span>
                <Button
                    dir="ltr"
                    className="button-color"
                >
                    אני מתחבר
                </Button>
            </form>
            <h5>או הירשם דרך </h5>
            <div>
                <SocialLoginButton
                    provider='facebook'
                    appId='995837254560670'
                    onLoginSuccess={trysuccess}
                    onLoginFailure={catcherr}
                >
                    Login with Facebook

                </SocialLoginButton>
                <SocialLoginButton
                    provider="google"
                    appId='773545842893-3kok7vvg64evbch0jqni8iamph6u084e.apps.googleusercontent.com'
                    onLoginSuccess={trysuccess}
                    onLoginFailure={catcherr}
                >
                    Login with gmail
                </SocialLoginButton>
            </div>

        </div>
    )
}
